/**
 * This will be my static creative application for a wordrobe selector
 * Author: Novia Wu
 * Date: 9/28/2021
 */

import React from "react";
import { View, Text, StyleSheet, ImageBackground } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import Welcome from "./components/Welcome";
import Wardrobe from "./components/Wardrobe";

export default function App() {
  const Stack = createNativeStackNavigator();

  function WelcomeScreen({ navigation }) {
    // return <Welcome navigation={navigation} />;
    return (
      <View style={styles.container}>
        <ImageBackground
          source={require("./assets/frontpage.jpeg")}
          style={styles.backgroundImg}
        >
          <View style={styles.logo}>
            <Text style={{ fontSize: 40, fontFamily: "Cochin" }}>
              WARDROBER
            </Text>
          </View>
          <View style={styles.welcome}>
            <Text
              style={{ fontSize: 30, fontFamily: "Cochin" }}
              onPress={() => navigation.navigate("Wardrobe")}
            >
              continue...
            </Text>
          </View>
        </ImageBackground>
      </View>
    );
  }

  function WardrobeScreen() {
    return <Wardrobe />;
  }

  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Welcome">
        <Stack.Screen name="Welcome" component={WelcomeScreen} />
        <Stack.Screen name="Wardrobe" component={WardrobeScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  backgroundImg: {
    width: "100%",
    height: "100%",
    flexDirection: "column",
  },
  logo: {
    flex: 8.5,
    alignItems: "center",
    justifyContent: "flex-start",
    top: 100,
  },
  welcome: {
    flex: 1.5,
    backgroundColor: "#ffffbf",
    alignItems: "center",
    justifyContent: "center",
  },
});
